var x = -1;

function foryzen(e){
    if(e.code!=='Backspace'){
        if(x<=373){
            x++;
            document.getElementById('console').innerHTML = array[x];
        }
    }else{
        if(x>=1){
            x--;
            document.getElementById('console').innerHTML = array[x];
        }
    }
}

